// src/components/ui/InputField.js
import './form.css';

export default function InputField({ 
  label, 
  type = 'text', 
  value, 
  onChange, 
  placeholder,
  required = false 
}) {
  return (
    <div className="form-group">
      {label && <label className="form-label">{label}</label>}
      <input
        type={type}
        value={value}
        onChange={onChange}
        placeholder={placeholder}
        required={required}
        className="form-input"
      />
    </div>
  );
}
